import React from 'react'

function FetchApi(){
    const apiGet=()=>{
        fetch('https://jsonplaceholdes.typicode.com/posts/1')
        .then((response)=>response.json())
        .then((json)=>console.log(json))
    }
  return (
    <div>
      <button onClick={apiGet} >FEtch api </button>
    </div>
  )
}

